import './Track.css';

function toMinutes(duration_ms) {
  let minutes = Math.floor(duration_ms/60000);
  let seconds = (duration_ms%60000) + '';

  return minutes + ':' + seconds.slice(0,2);
}

export default function Track({ track }) {
  return (
    <div className='track'>
      <div className='id'>{ track.id }</div>
      <div className='artists'>{ track.artists[0] }</div>
      <div className='name'>{ track.name }</div>
      <div className='duration'>{ track.duration }</div>
      <div className='image'>{ track.image }</div>
    </div>
  )
}
